window.bookSummaryJSON = "<p><b>Xander Brown is a skilled surgeon who lives a carefree life. With him being the Chief of Surgery at GHM, his plate is always full. However, he made room for the one woman he couldn't see himself without.</b></p> <p>Zara Lyles is the hood Barbie; that's all about her family. She does what needs to be done for them to survive, all while keeping a certain elegance. As usual, she has it all together without the help of a man.</p> <p>They are two individuals from two different worlds who find a good time with each other. Obsession is another form of love in their eyes.</p>"; 
